import axios from "axios";
import React, { useEffect, useState } from "react";

const ProvidersMovies = ({ id }) => {
  const [data, setData] = useState([]);

  useEffect(() => {
    axios
      .get(
        `https://api.themoviedb.org/3/movie${id}/watch/providers?api_key=864b6602f4018630491e67fa714381e6`
      )
      .then((res) => {
        if (res.FR) {
          return setData(res);
        } else if (res.US) {
          return setData(res);
        } else {
          return setData("Pas de providers disponibles ");
        }
      });
  }, [id, data]);

  return <div>{data[1]}</div>;
};

export default ProvidersMovies;
